import React from 'react';

/**
 * タスクのコンポ
 */
class Task extends React.Component {

	constructor(props) {
		super(props);
		this.state = {
			doList: [{ props }]
		}
	}

	display() {
		this.state.setList('New Value')
	}

	render() {
		return (
			<div>
				<li>
					<input type='checkbox' />
					{/*listを作って追加していく*/}
					{this.display}
				</li>
				<hr />
			</div>
		);
	}
}

export default Task;
